import React, { Component } from "react";
import '../../App.css';
import LeftDrawer from '../Drawer/Drawer';
import * as videoStyles from  "../../styles/video";


class Home extends Component {

    constructor(props){
        super(props);       
    }
 
  


    render() {
        var date = (new Date().getMonth() + 1) + "/" + new Date().getDate() + "/" + new Date().getFullYear();
        var location = "37.3352째 N, 121.8811째 W";
        var city = "San Jose"
        var camera = "Camera A103";

        return (
        <div  style={videoStyles.background} >
         
           
            <div  style={videoStyles.videoContainer}  >
            <LeftDrawer></LeftDrawer>
            <div style={videoStyles.videoFrame}>
                <iframe style={videoStyles.video} src='https://295-videos.s3.us-east-2.amazonaws.com/jellyfish-25-mbps-hd-hevc.mp4' width='100%;' height='500px'></iframe>
            </div>
              {/*   <iframe style={videoStyles.video} width="700px" height="400px" src="https://295-videos.s3.us-east-2.amazonaws.com/San-Jose-16th-Oct-2019.mp4"></iframe> */}
                <div style = {videoStyles.videoInfo}><h5> Date: {date} &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Location: {location} &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; City: {city}  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;  Camera: {camera}</h5><h1>16:29</h1></div>
              
            </div>
   
        </div> 

        );
    }
}



export default Home;
